import { FETCH_MYLIST, REMOVE_FROM_MYLIST } from '../actions/index';

export default function (state = initialstate, action){
    switch (action.type) {
        case REMOVE_FROM_MYLIST:
        return {removedlist: state.filter(list => list !== action.payload)}
        default:
            return state;
